import React from 'react';
import { Typography } from '@material-ui/core';

const HomeMain = () => {
    return (
        <div>
            <Typography className="HomeMain" variant="h1" component>
                ساخته شده برای تیم های حرفه ای
            </Typography>
        </div>
    )
}

export default HomeMain;
